import React from "react";

function ProjectItem({project, title, link}) {
  return (
    <>
      <div
        href="##"
        className="bg-white overflow-hidden drop-shadow-md dark:drop-shadow-xl w-96 h-80 rounded-md items-center justify-center"
      >
        <div className="w-full bg-cover">
          <img src={project} alt="" className="w-full h-56" />
        </div>
        <div class="flex px-3.5 mt-4 space-x-24 md:mt-6 absolute bottom-3">
          <h3 className="inline-flex font-bold text-xl">
            {title}
          </h3>
          <a
            href={link}
            class="inline-flex items-center py-2 px-4 text-sm font-medium text-center text-gray-900 bg-white rounded-lg border border-sky-400 hover:bg-sky-300"
          >
            Source
          </a>
        </div>
      </div>
    </>
  );
}

export default ProjectItem;
